import React, { Component } from 'react'

import cover from '../cover.jpg'
import ReactPlayer from 'react-player';


export default class Home extends Component {
    state = {
        playing : false
    }

    togglePlaying = () => {
        this.setState({playing: !this.state.playing})
    }
    render() {
        return (
            <div style = {{position: 'absolute', top: 0, left: 0, display: 'block', width: '100%'}}>
                <img style = {{width: '100%', verticalAlign: 'middle'}} src = {cover} alt="cover photo"/>

                <div style = {{height: '300px', width: '300px', backgroundColor: 'blue', position: 'relative', top: '-50px'}}>

                </div>
                <div style = {{height: '700px', backgroundColor: 'black'}}>
                    <div style = {{display: 'flex', flexDirection: 'row'}}>
                        <ReactPlayer 
                            url='https://www.youtube.com/watch?v=rB1UiWBkIZU'
                            width = {0}
                            height = {0}
                            playing = {this.state.playing}
                            onReady = {() => console.log("Ready")}/>

                        <div onClick = {this.togglePlaying} style = {{height: 100, width: 100, backgroundColor: 'purple'}}>
                            <p>PLAY</p>
                        </div>
                    </div>

                </div>
            </div>
          );
    }
}
